import React from 'react';

const CategorySection = () => {
  return (
    <section className="container mx-auto my-8 text-center flex justify-between">
        <div>
      <h2 className="text-2xl font-bold mb-4">Ready to Dive into HABOT?</h2>
      <p className="text-gray-600">Find suppliers, buyers, or new opportunities.</p>
      </div>
      <div className="flex flex-col items-center mt-4 space-y-2">
  <div className="flex justify-center space-x-2">
    <button type="button" className="btn btn-outline-warning">Abu Dhabi</button>
    <button type="button" className="btn btn-outline-warning">Dubai</button>
  </div>
  <div className="flex justify-center space-x-2">
    <button type="button" className="btn btn-outline-warning">Sharjah & Ajman</button>
    <button type="button" className="btn btn-outline-warning">Fujairah</button>
  </div>
  <div className="flex justify-center space-x-2">
    <button type="button" className="btn btn-outline-warning py-2">Warning</button>
    <button type="button" className="btn btn-outline-warning">Warning</button>
  </div>
</div>

    </section>
  );
};

export default CategorySection;
